  [],\n\t\"revision_timestamp\": \"2013-03-15T11:40:49.436423\",\n\t\"name\": \"color-infrared-aerial-photosmosaics-for-indiana-dunes-national-lakeshore-vegetation-mapping-pro\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Color infrared (CIR) aerial photographs
  were acquired as baseline imagery data to produce vegetation spatial database coverages
  of Indiana Dunes National Lakeshore (INDU) and environs. The aerial photos were
  collected on October 21, 2004 and October 24, 2004 at a scale of 1:12,000 to capture
  peak fall leaf phenology. The U.S. Geological Survey (USGS) Upper Midwest Environmental
  Sciences Center (UMESC) of La Crosse, Wisconsin has produced spatially referenced
  aerial photo mosaic images of the aerial photographs for the East Unit, West Unit
  with Calumet Prairie, Pinhook Bog, Heron Rookery, Hobart Prairie Grove, and Hoosier
  Prairie units and their environs. The photo mosaics are raster datasets compressed
  with MrSID (LizardTech), projected in Universal Transverse Mercator (UTM), Zone
  16, using the North American Datum of 1983 (NAD83).\",\n\t\"license_title\": null,\n\t\"extras\":
